        </div>
        <hr/>
        <div>
                <label>Employee Date Of Birth</label><br/>
                  <input name="dob" type="date" {...empEntry}/>
                  <small>{ errors?.dob && errors.dob.message }</small>
        </div>
        <hr/>
        <div>
            <label>Employee Joining Date</label><br/>
            <input name="joinDate" type="date" {...empEntry}/>
            <small>{ errors?.joinDate && errors.joinDate.message }</small>
